import React from "react";
import Header from './Header';
import CreateNote from './CreateNote';
import Note from './Note';
import footer from './footer';


const Goo =()=>
{
    const addNote=()=>
    {
        alert("I am Clicked");
    }

    return(
      <>
      <Header/>
      <CreateNote passNote={addNote}/>
      <Note/>
      <footer/>
      </>
    );
};

export default Goo;
